import * as React from 'react';
import { Navigator, View, Button, Text, StyleSheet, TextInput, Image, Dimensions, ActivityIndicator } from 'react-native';
import { signOut, firebaseUser, db, user } from './controller/user-management/Firebase_Helper'
import User from './model/User';
import FirebaseController from './controller/user-management/Firebase_Helper'

export default class MainScreen extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            isLoading: true,
            dataSource: null,
        }
    }
    componentDidMount() {
        return fetch("http://localhost:8000/getAllMerchantOauth")
        .then(response => response.json())
        .then( (responseJson) => {
            this.setState({
                isLoading: false,
                dataSource: responseJson.merchants
            })
        })
        .catch((error) => {
            console.log(error);
        });
    }

    render() {
        const { navigation: { navigate } } = this.props;
        let merchantOath = this.state.dataSource.map((val,key) => {
            return <View key = {key}> 
                    <Text>{val.merchant_id}</Text>
                    <Text>{val.access_token}</Text>
                </View>
        });
        if  (this.state.isLoading) {
            return (
                <View style = {styles.container}>
                  <ActivityIndicator />  
                </View>

            )
        }
        return (

            <View style = {styles.container}>
                {/* <MapView style={styles.mapStyle} initialRegion={{
                    latitude: 37.78825,
                    longitude: -122.4324,
                    latitudeDelta: 0.0922,
                    longitudeDelta: 0.0421,
                }}/> */}
                {merchantOath}
            </View>
        );
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
    },
    welcometxt: {
        marginTop: 50,
    },
    mapStyle: {
        width: Dimensions.get('window').width,
        height: Dimensions.get('window').height,
      },

});
